 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-07-07 19:23:41', '2016-07-07 19:34:57', '78da33be-39fa-4bb7-962f-80c7c6827292'),
 ('2', '2', 'en_us', 'Welcome to Leo Gecko!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. We have just installed the CMS, and we’re setting things up for the content editors this very moment. Soon Leo Gecko will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again and again!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-07-07 19:23:43', '2016-07-08 15:32:27', '3d9909ff-78b3-4ed9-9e73-c491d25fd8fc'),
 ('4', '4', 'en_us', 'About', '<p>There\'s nothing unique about us. In fact, we\'re probably just like you, having a love for reptiles and an overbearing desire to love the oh-so personable leopard gecko. We are not breeders or specialists in any way. We\'ve learned by trial, error and the internet. So much that we like to think our geckos live in a technologically advanced environment. True. I like to tap a camera that I have pointed into their crate and watch them regardless of where I\'m at. Also, like having the ability to monitor humidity and temp from afar. With todays tech, I can provide better for them even if I am a bit anal about it.</p>\n\n<p>We decided to start blogging after many began contacting us and asking a ton of questions. I love answering those questions but it became so time consuming none of us could keep up. Additionally, a lot of the questions and comments we began receiving didn\'t make sense to us so a blog was born.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>You\'re more than welcome to take what interest you but please give of us a shout-out if your using our content elsewhere. Leave the rest at the curb for someone else. Remember, we are not experts and have several $300 vet bills to prove it!</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-07-08 21:35:26', '2016-07-10 17:30:59', '170199d4-cdde-4906-9f89-4b0157a724e6'),
 ('5', '5', 'en_us', 'Feeding Gecko', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Yummmm!', 'Feeding Crickets?', NULL, NULL, '2016-07-08 22:24:04', '2016-07-12 23:45:34', '4918b4cb-7661-4bd2-91b3-c605b9f1325e'),
