 ('30', '30', 'en_us', 'orb1', NULL, NULL, 'our geckos', '<ul><li>baby geckos</li><li>small geckos</li><li>large geckos</li></ul>', '<p>Of course, we think our leopard geckos are the best and most unique of reptiles. Hopefully, this is how you feel about yours. We also think of our geckos as the greatest of entertainers but each of them have unique personalities. HayDay for instance is our climber. Once the crate opens up her head is pointed straight up and she awaits a lift into the outer domain. She is curious and leaves no stone unturned. She is by far the most active. Additionally, she is not sexually mature as our other female is. She also has no issue with buddying up with our mature male or even stepping on his head to get to food. She is a big eater, too.</p>\n\n<p>Alice is a sexually mature female who is currently laying eggs every 2 weeks...</p>\n\n<p>Mr. Cleo is our stud...</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-07-10 18:45:08', '2016-07-10 22:43:38', 'e9cb93e9-4319-4ed2-8e74-a2eef3911bbd'),
 ('31', '31', 'en_us', 'orb2', NULL, NULL, 'gecko food', '<ul><li>mealworms</li><li>dubia roaches</li><li>superworms</li></ul>', '<p>We feed our leopard geckos meal worms for a staple and supplement their diets with dubias, wax worms, occasional superworms as well as calcium + D3...</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-07-10 19:12:17', '2016-07-10 22:35:44', '6dd4397f-75ac-47ca-92e6-53a2df735f30'),
 ('32', '32', 'en_us', 'orb3', NULL, NULL, 'gecko care', '<ul><li>habitat</li><li>sexing: male or female</li><li>health/sickness</li></ul>', '<p>As with all pets, leopard geckos depend on us for complete and unconditional care. The better their habitat and environment is maintained the happier they are. </p><p>When we received Mr.Cleo he was in dire straits. He wasn\'t malnourished but he had several layers of bad sheds that had piled up in bad places. His eyelids and toes took the worse hit. I had no idea how to care for a leopard gecko other than a crash course of Google but one thing I was sure about. He didn\'t look right. His eyes were black and he was not eating. So, I took him to the vet who luckily had leopard geckos of her own. $260 later we took Mr. Cleo home. In the ensuing few days, I learned that because his eyes were infected due to the bad sheds piling up on his lower eyelids, he could not see his food so gave up on hunting. 2-3 times a day I gave him eye drops and fed him through a syringe. Within 2 weeks he began eating again and had a perfect shed thanks to being moved into an environment where we could monitor and maintain humidity. </p><p>The point of this story is that we inherited Mr.Cleo and knew nothing about caring for him. However, he let us know the best way he could that he needed help. That was a long time ago and I\'ve not had to take any of our leo\'s to a vet since (knock on wood). We love them and look after them daily. We are lucky to have each other.  </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-07-10 19:17:03', '2016-07-10 22:53:06', '1956fc8b-b498-4a39-884d-682593157f80'),
