 ('15', '4', '5', '1', 'en_us', '9', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"About\",\"slug\":\"about\",\"postDate\":1468013726,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>There\'s nothing unique about us. In fact, we\'re probably just like you, having a love for reptiles and an overbearing desire to love the oh-so personable leopard gecko. We are not breeders or specialists in any way. We\'ve learned by trial, error and the internet. So&nbsp;much that we like to think&nbsp;our geckos live in a technologically advanced environment. True. I like to tap a camera that I have pointed into their crate and watch them regardless of where I\'m at. Also, like having the ability to monitor humidity and temp from afar. With todays tech, I can provide better for them even if I am a bit anal about it.<\\/p>\\r\\n\\r\\n<p>We decided to start blogging after many began contacting us and asking a ton of questions. I love answering those questions but it became so time consuming none of us&nbsp;could&nbsp;keep up. Additionally, a lot of the questions and comments we began receiving didn\'t make sense to us so a blog was born.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>You\'re more than welcome to take what interest you but please give of us a shout-out if your using our content elsewhere. Leave the rest at the curb for someone else. Remember, we are not experts and have several $300 vet bills to prove it!<\\/p>\",\"7\":[\"9\"],\"2\":\"\"}}', '2016-07-09 20:18:25', '2016-07-09 20:18:25', '5fa90939-2f81-4a9c-8ef3-a5f1460f4f1b'),
