 ('4', 'field', '1', 'en_us', ' there s nothing unique about us in fact we re probably just like you having a love for reptiles and an overbearing desire to love the oh so personable leopard gecko we are not breeders or specialists in any way we ve learned by trial error and the internet so much that we like to think our geckos live in a technologically advanced environment true i like to tap a camera that i have pointed into their crate and watch them regardless of where i m at also like having the ability to monitor humidity and temp from afar with todays tech i can provide better for them even if i am a bit anal about it we decided to start blogging after many began contacting us and asking a ton of questions i love answering those questions but it became so time consuming none of us could keep up additionally a lot of the questions and comments we began receiving didn t make sense to us so a blog was born you re more than welcome to take what interest you but please give of us a shout out if your using our content elsewhere leave the rest at the curb for someone else remember we are not experts and have several $300 vet bills to prove it '),
